import React from "react";
import "./Toolbar.css";
import Logo from "./Logo/Logo";
import Search from "./../UI/Search/Search";
import Icons from "../UI/Icons/Icons";

export default function Toolbar() {
  return (
    <div>
      <Logo />
      <h1>Tollbar</h1>
      <Search />
      <Icons type="bag" />
      <Icons type="user" />
    </div>
  );
}
